import React, { Component } from 'react';
import WebsiteLayout from '../../components/wrapper/mainSite';

export default class TransitCity extends Component {
	render() {
		return (
			<WebsiteLayout>
				<div>transit-city</div>
			</WebsiteLayout>
		);
	}
}
